// DataDisplay.js

import React, { useEffect, useState } from 'react';
import axios from 'axios';

function DataDisplay() {
  const [data, setData] = useState([]);
  const [isLoading, setIsLoading] = useState(true);

  useEffect(() => {
    // Replace 'API_URL' with the actual URL of the API you want to fetch data from.
    const apiUrl = 'http://localhost:8000/api/countrydata/';

    axios.get(apiUrl)
      .then((response) => {
        setData(response.data);
        setIsLoading(false);
      })
      .catch((error) => {
        console.error('Error fetching data:', error);
        setIsLoading(false);
      });
  }, []);

  if (isLoading) {
    return <div>Loading...</div>;
  }

  return (
    <div>
      <h1>JSON Data from API</h1>
      <ul>
        {data.map((item) => (
          <li key={item.id}>{item.name}</li>
          // Replace 'id' and 'name' with the keys you want to display from your JSON data.
        ))}
      </ul>
    </div>
  );
}

export default DataDisplay;
